		}
	}
	//console.log(data.Url,maxcost);
	var cartypeCostColor = "hsl("+rndInt(0,360)+","+rndInt(30,70)+"%,"+rndInt(30,60)+"%)";
	for(var i=0,v,cost,seats ; i<data.Vehicles.length ; i++) {
		v = data.Vehicles[i];
		cost = v.CostInt;
		
		tr = $("<tr></tr>");
		tr.data = data;
		
		$(tr).append("<td>"+v.Name+"</td>");
		$(tr).append("<td>"+v.Url+"</td>");
		seats = "";
		for(var j=0;j<v.Seats;j++) {
			if(j>3){
				seats += "<span style='background-color:#bb0;'></span>"
			} else {
				seats += "<span></span>"
			}
		}
		$(tr).append("<td class='s_seats' title="+v.Seats+">"+seats+"</td>");
		$(tr).append("<td>"+data.Name+"</td>");
		$(tr).append("<td>"+v.Type+"</td>");
		

		$(tr).append("<td title='"+cost+"'><span class='s_cost' style='width:"+Math.round(cost/maxcost*100)+"px; background-color:"+cartypeCostColor+"'>"+cost+"</span></td>");
		$(tr).append("<td class=''>"+
			"<span class='s_speed' title='"+v.Speed+        "' style='"+(v.TopSpeed?       'border-bottom:1px solid #f00;':'')+"width:"+v.Speed+"px'>"+v.Speed+"&nbsp;</span>"+
			"<span class='s_accel' title='"+v.Acceleration+ "' style='"+(v.TopAcceleration?'border-bottom:1px solid #f00;':'')+"width:"+v.Acceleration+"px'>"+v.Acceleration+"&nbsp;</span>"+
			"<span class='s_brake' title='"+v.Braking+      "' style='"+(v.TopBraking?     'border-bottom:1px solid #f00;':'')+"width:"+v.Braking+"px'>"+v.Braking+"&nbsp;</span>"+
			"<span class='s_handl' title='"+v.Handling+     "' style='"+(v.TopHandling?    'border-bottom:1px solid #f00;':'')+"width:"+v.Handling+"px'>"+v.Handling+"&nbsp;</span>"+
			"</td>");
			
		$(tr).append("<td>"+(v.Personal?'GARAGE':'')+"</td>");
		$(tr).append("<td>"+(v.Premium?'Premium':'')+"</td>");
		$(tr).append("<td>"+(v.Moddable?'Mod':'')+"</td>");
		$(tr).append("<td>"+(v.ForSale?'ForSale':'')+"</td>");
		$(tr).append("<td>"+(v.Sellable?price_parse(v.SellPrice):'')+"</td>");
		$(tr).append("<td>"+(v.Conditional?v.Conditional:'')+"</td>");
		$(tr).append("<td>"+(v.Website?v.Website:'')+"</td>");
		$('#car_table').append(tr);
	}
}
function price_parse(data){
	return data.replace(/[\$,\.\*]/g,'').replace('M','000000').replace('K','000');
}
function makelist() {
	$("body").append("<table id='car_table'></table>");
	for(cartype in cardata) {
		addCarType(cardata[cartype]);
	}
}
function rndInt(min,max){
    return Math.floor(Math.random()*(max-min+1)+min);
}
$( document ).ready(function() {
	makelist();
});
</script>
